                </td> */}
                {/* <td> {btnNotClicked === false ? <button onClick={clickHandle}>not seated</button> : <button>seated</button>}</td> */}

                {/* <td>{!btnNotClicked && <button onClick={clickHandle}>not seated</button>}</td> */}
                <div>
                  <div onClick={() => setShow(true)}>{show && <div>John</div>}</div>

                  {show && <div>Mike</div>}
                </div>
              </tr>
            )
          })}
        </tbody>
      </table>
    </div>
  )
}

export default Table
